site.headStyle:
.in-front {
  z-index: 2;
}


div.shadow:before, div.shadow:after {
  content: " ";
  height: 100%;
  position: absolute;
  top: 0;
  width: 15px;
}
div.shadow:before {
  box-shadow: -15px 0 15px -15px inset;
  left: -15px;
}
.silex-editor div.shadow:before {
  box-shadow: -15px 0 15px -15px inset;
  xmargin-left: -15px;
}

div.shadow:after {
  box-shadow: 15px 0 15px -15px inset;
  right: -15px;
}

.text-shadow {
  text-shadow: 2px 0 2px #000, -2px 0 2px #000, 0 2px 2px #000, 0 -2px 2px #000;

}

.open-jobs {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 56px;
  line-height: 56px;
  /* identical to box height, or 100% */


  color: black;

  mix-blend-mode: normal;
}
.open-jobs-text {
  font-family: 'Mulish';
  font-style: normal;
  font-weight: 300;
  font-size: 18px;
  line-height: 30px;
  /* or 167% */

  text-align: center;

  color: #7D7987;

  mix-blend-mode: normal;
}
.job-card {
  box-shadow: 10px 40px 50px rgba(229, 233, 246, 0.4);
  border-radius: 20px;
}
.job-card-title {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 150%;
  /* identical to box height, or 36px */


  /* gray/900 */

  color: #18181B;
}
.job-card-rate {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;
  line-height: 24px;
  /* identical to box height, or 100% */

  letter-spacing: -0.5px;

  color: #3F3F46;
}
.job-card-tags {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  /* identical to box height, or 24px */


  /* gray/700 */

  color: #3F3F46;
}
.job-card-skill-card {
  border-radius: 7px;
}
.job-card-skill-card-text {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 22px;
  /* identical to box height, or 160% */


  color: #1F1F1F;
}
